import { useEffect, useState } from "react";

export function City(data) {
    
    let city = data.title;

    let [getCity, setCity] = useState(city);

    useEffect(() => {
        setCity(() => {
            
            if(city !== undefined) {
                getCity = city;
            } else {
                getCity = "Desconhecido!";
            }
            
        })
    }, [])
    
    
    
    console.log(data.title);
    

    return(
    <div>
        <p>{city}</p>
    </div>
    );
}
